INSERT INTO `review` (`id`, `title`, `type`, `address`, `description`, `likes`, `dislikes`, `approved`, `user_id`, `filename`, `image`) VALUES
(13, 'Azul e Branco', 'restaurant', 'Av. Duque de Loulé 81 83, 1050', 'Restaurant menu:\r\nChef Bruno Nunes\r\nAverage price €35\r\nFood options: Vegetarian dishes', 44, 3, 1, 54, 'azul-e-branco.jpg', );
INSERT INTO `review` (`id`, `title`, `type`, `address`, `description`, `likes`, `dislikes`, `approved`, `user_id`, `filename`, `image`) VALUES
(14, 'Lisbon Marriott', 'hotel', 'Av. dos Combatentes 45, 1600-0', 'We loved this hotel. Very close to the airport and the service and level of appointment was top notch. We ordered room service and our meals came quickly and they were delicious. The portions were huge and they were priced the same as in the dining room, which was perfect for two weary travellers that just wanted to crack open a bottle of wine and enjoy a great meal in our room watching the huge TV. We will certainly return to this amazing hotel\r\nRooms 5.0 Service 5.0 Location 5.0\r\nHotel highlights: Luxury', 22, 5, 1, 17, 'Marriot.jpg', 0x36343864643733333738353730),
(15, 'Gota Dagua', 'Activity', 'Tarquinio Beach-Bar, 2825-392 ', 'I never leave online reviews but due to our amazing experience with Gota Dagua Surf School I had to make an exception. We are so happy we signed up our children (8 and 9) with these guys for a private (2 kids, one instructor) lesson. They were sincerely welcoming and encouraging and put me, a mom who has never surfed, completely at ease. They never spoke down to our children and were always positive. We ended up doing 3 lessons over the course of 4 days we were so happy. The kids had a blast and never once did I think they were not safe. My kids had Alan and he was their greatest fan and now we are his greatest fans. Alan always encouraged, never discouraged and pushed them a little more each lesson and celebrated their “wins” and “losses”. What a positive , wholesome experience. I couldn’t recommend this surf school more highly and we will be back!', 10, 5, 1, 18, 'Gota.jpg', 0x36343864643961353462303538),
(16, '7 Luz Hostel', 'Hotel', 'R. dos Arneiros 31 R/C esq, R/', 'The hostel take my money, confirmed reservation and when I came don’t open the door. Be careful!!\r\nRooms 1.0 Service 1.0 Location 1.0', 5, 7, 1, 53, 'luz.jpg', 0x36343865353964616539616537),
(17, 'Calouste Gulbenkian', 'Museum', ' Av. de Berna 45A, 1067-001 Li', 'The Calouste Gulbenkian Museum houses one of the world\'s most important private art collections. It includes works from Ancient Egypt to the early 20th century, spanning the arts of the Islamic World, China and Japan, as well as the French decorative arts, the jewellery of René Lalique and some of the most important painters of all times works such as Rembrandt, Monet, Rubens, Manet, Renoir, Degas and Turner.', 5, 0, 1, 52, 'gulben.jpg', 0x36343865353965366361393833),
(18, 'Bairro Alto', 'Hotel', 'Praca Luis de Camões No. 2, Li', 'It is in an old building,  but the interior decor is so well done you would not notice any age at all. Their balcony restaurant serves the most wonderful breakfast with four kinds of sourdough bread and restaurant made butter. The balcony view is so wonderful but do reserve your table otherwise you will have to sit inside.  Lunch and dinner meals are also very good.\r\nRooms: 5\r\nService: 5\r\nLocation: 4\r\nRooms:Good size rooms with lots of amenities. The sink counter in the bathroom is a bit small but very luxurious.\r\nHotel highlights: Luxury, Great view', 0, 0, 1, 54, 'bairro.jpg', 0x36343865356238636631383737),
(19, 'Huang He ', 'Restaurant', 'Av. de Berna 21A, 1050-053 Lis', 'Great food, great service, what more could you ask for! :)', 0, 0, 1, 55, 'huang.jpg', 0x36343865653266303731396635666f746b65312e6a706567),
(21, 'Holiday Inn', 'Hotel', 'Av. de António José de Almeida', 'Set in the commercial district, this casual hotel is a 7-minute walk from a metro station and 4 km from 11th-century Moorish Castelo de São Jorge.\r\nStraightforward rooms feature free Wi-Fi, flat-screen TVs, safes and minibars, plus tea and coffeemakers. Some have pull-out sofas, while suites add living rooms. Room service is available 24/7. Kids age 17 and under stay with a parent at no extra cost.\r\nAmenities include a relaxed buffet restaurant, and an informal bar with TVs, as well as a seasonal rooftop lounge and outdoor pool with a terrace and city views. There\'s also a fitness room. Breakfast and parking are available for a fee.', 2, 5, 1, 17, 'holidayinn.jpg', 0x36343865656530386466646661666f746b652e706e67),
(24, 'Q', 'Restaurant', 'Q street', 'Very modern, ok food.', 3, 10, 1, 54, 'fotke1.jpeg', ''),
(25, 'Azulejo', 'Museum', 'R. Me. Deus 4, 1900-312 Lisboa', 'The Museu Nacional do Azulejo, occasionally known in English as the National Tile Museum, is an art museum in Lisbon, Portugal dedicated to the azulejo, traditional tilework of Portugal and the former Portuguese Empire, as well as of other Iberophone cultures.', 4, 2, 1, 18, 'azul.jpg', ''),
(26, 'Balkon', 'Restaurant', 'Av. Liberdade', 'A new, hip restaurant in a very famous neighbourhood. Dishes are mixed cultures. Wait staff is incredibly nice. Unfortunately prices are too much for the average citizen.', 44, 5, 1, 54, 'fotke2.jpg', ''),
(28, 'Dine in Faro', 'Restaurant', 'ssssssc 12', 'sasss', 0, 0, 0, 55, 'faro.jpg', ''),
(29, 'hh', 'Restaurant', 'ssssssc 12', 'sasss', 0, 0, 0, 55, 'faro.jpg', '');

